function twoSum1($numbers, $target)
{
    $res = array();
    $len = count($numbers);
    for ($i = 0; $i < $len; $i++)
    {
        for ($j = $i+1; $j < $len; $j++)
        {
            if ($numbers[$i] + $numbers[$j] == $target)
            {
                $res[0] = $i;
                $res[1] = $j;
                return $res;
            }
        }
    }
    return $res;
}

